import React from 'react';


export default props => {

    const {info} = props;

    const looks = {
        height: "350px;",
        width: "fit-content;",
        overflow: 'scroll',
    }

    return(
        <div>
            <h2>Product List: </h2>
            {
                info.map((item, i) =>
                  <p key={i}> {item.title}</p>
                )
            }
        </div>
    )


}
